std::complex<double> DT::A1A1TtTree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return -((sqrt(2.)*(MHSqcomp - MS1Sqcomp)*s*token16*token2*token36*(token11 + token9)*(s - 4.* (MT*MT)))/((MHSqcomp - s)*(-MS1Sqcomp + s)*token28));
}

std::complex<double> DT::A1A1TtTreeConj(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return std::conj(-((sqrt(2.)*(MHSqcomp - MS1Sqcomp)*s*token16*token2*token36*(token11 + token9))/(2.*(MHSqcomp - s)*(-MS1Sqcomp + s)*token28)));
}

